// 0至50为一级优，51至100为二级良，101至150为三级轻度污染，151至200为四级中度污染，201至300为五级重度污染和300以上为六级严重污染
export function getPM_2_5Level(data){
    if(data < 0){
        return {
            name:"暂无数据",
            img:[],
        };
    }else if(data <= 50 && data >=0){
        return {
            name:"优",
            img:[
                "data:image/svg+xml;base64,",
                "data:image/svg+xml;base64,",
                "data:image/svg+xml;base64,",

            ],
        };
    }else if (data<=100 && data>50){
        return {
            name:"良",
            img:[
                "data:image/svg+xml;base64,",
                "data:image/svg+xml;base64,",

            ],
        };
    }else if (data<=150 && data>100){
        return {
            name:"轻度污染",
            img:[
                "data:image/svg+xml;base64,",

            ],
        };
    }else if (data<=200 && data>150){
        return {
            name:"中度污染",
            img:[
                "data:image/svg+xml;base64,",

            ],
        };
    }else if (data<=300 && data>200){
        return {
            name:"重度污染",
            img:[
                "data:image/svg+xml;base64,",

            ],
        };
    }else if (data>300){
        return {
            name:"严重污染",
            img:[
                "data:image/svg+xml;base64,",

            ],
        };
    }
}
